import React from "react";
import { useEffect } from "react";
import {jMoment} from 'jalali-moment'

export const ConvertData = ({ data }) => {
  useEffect(() => {
    console.log(data[0].created_at);
    jMoment(data[0].created_at).format(jYYYY/jMM)
  }, []);
  return <div></div>;
};
